var tipuesearch = {"pages": [{'title': 'About', 'text': 'wcm2022課程網站連結 \n 網站 : https://kehueisin.github.io/wcm2022/ \n 倉儲 : https://github.com/KEHUEISIN/wcm2022 \n 分組網站 : https://kehueisin.github.io/wcm2022ag1/ \n 分組倉儲 : https://github.com/KEHUEISIN/wcm2022ag1 \n \n 此為個人網站首頁!! \n ---------------------------------------------------------------------------------------------- \n', 'tags': '', 'url': 'About.html'}, {'title': '報告1', 'text': 'Tetris 線上遊戲專案報告2 \n 我發現當我將老師所寫的那一串程式中間直接加入已寫的Tetris程式網頁就出現Tetris這個遊戲的介面，操作結果為下。 \n 配置過程: \n 先在自己的動態網頁中Edit All加入一個目錄，後點選該目錄的Edit ，進入後在點選Source code插入下列html文字檔中的程式，將其複製到Source code中，在中間加入Tetris程式碼，按下save，在按viewpage回到目錄中，檢查Tetris是否出現在該頁面上，若出現並正常執行則代表成功，後將動態網頁push成靜態網頁看看在動態網頁中能否看到Tetris。 \n 此為程式html文字檔: \n \n <!-- 導入 Brython 程式庫 --> \n <script src="./../cmsimde/static/brython.js" =導入之路徑 ></script> \n <script src="./../cmsimde/static/brython_stdlib.js" =導入之路徑 ></script> \n <!-- 啟動 Brython --> \n <script> \n window.onload=function(){brython();} =此 方法用于在網頁加載完畢後立即執行的操作 </script> \n <script type="text/python3"> = 在 HTML 文件的 <script> 標記內運行 python 代碼 \n #print("可執行 Brython") =用print來執行Brython \n \n <<需顯示之遊戲程式碼>> \n \n </script> \n <div id="brython_div"></div> =在div中使用id，brython_div為自定義的命名 \n \n \n', 'tags': '', 'url': '報告1.html'}, {'title': '報告2', 'text': '網際內容管理課程期末報告2 \n wink:  需先錄製一段影片，後到老師所給的程式碼加入超文件範本，將影片插入我所要放置的頁面，並將超文 件內的(名稱.mp4)改成自己所設的名稱。( 影片路徑為wcm2022/downloads中 ) \n onedrive:  因他容量有限制，每個人儲存空間只限 3GB，在此之前我並不知道，還把它的檔案備份開啟導致我的硬碟出現容量過少的問題，後上網尋求解答，須登入自己的onedrive將備份關掉，並刪除備份檔案，一切操作結束後，在重新啟動，電腦C槽就能正常運作。 \n Github:  如何建立紙模組，從不同的網站下載我所需要使用的目錄，並加入個人建的資料夾中。 \n WIN10:  到wmc.cycu.org:88下載建立WIN10所需要的檔案，下載至自己的資料夾中，並解壓縮，而後在到virtualbox網站下載virtualbox程式，下載好後，建立一個虛擬主機，將剛剛下載的檔案加入至virtualbox中，執行登入後，連接電腦輔助設計室的網路，接續下載其他程式。 \n w13:  將Tetris 加入到個人的動態網頁上，在Source code中插入程式碼，開頭與結尾是照老師所寫的程式做複製與貼上，中間則是run中程式，我發現只要結尾跟中間不變，更改中間的內容一樣能執行。 \n w14:  將老師給的舊名單改成新的，我先去到個人Github gist中輸入文字並建立連結，後將連結貼到老師寫的分組結果程式碼中，過程中，一直發現多了一人但實際看多餘的那位同學並未修課，去老師的網站看也沒有那位同學，所以我不確定她是否有修，程式列印出來也沒有她，放置程式的想法有參照同學的做法。 \n', 'tags': '', 'url': '報告2.html'}, {'title': '建立網頁python 框架', 'text': ' 導入 FileSaver 與 filereader  \n \n \n \n \n  導入 ace  \n \n \n \n \n \n \n  請注意, 這裡使用 Javascript 將 localStorage["py_src"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  印出版次與關鍵字程式  \n \n \n \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  Filename:  .py    存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div 作為切入位置  \n \n 欽入網頁python框架: \n \n \n <!-- 導入 brython 程式庫 -->\n<script src="./../cmsimde/static/brython.js"></script>\n<script src="./../cmsimde/static/brython_stdlib.js"></script>\n<!-- 啟動 Brython -->\n<script>// <![CDATA[\nwindow.onload=function(){\nbrython({debug:1, pythonpath:[\'./../cmsimde/static/\',\'./../downloads/py/\']});\n}\n// ]]></script>\n<p><!-- 導入 FileSaver 與 filereader --></p>\n<p>\n<script type="text/javascript" src="./../cmsimde/static/ace/FileSaver.min.js"></script>\n<script type="text/javascript" src="./../cmsimde/static/ace/filereader.js"></script>\n</p>\n<p><!-- 導入 ace --></p>\n<p>\n<script type="text/javascript" src="./../cmsimde/static/ace/ace.js"></script>\n<script type="text/javascript" src="./../cmsimde/static/ace/ext-language_tools.js"></script>\n<script type="text/javascript" src="./../cmsimde/static/ace/mode-python3.js"></script>\n<script type="text/javascript" src="./../cmsimde/static/ace/snippets/python.js"></script>\n</p>\n<p><!-- 請注意, 這裡使用 Javascript 將 localStorage["py_src"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱--></p>\n<p>\n<script type="text/javascript">// <![CDATA[\nfunction doSave(storage_id, filename){\n    var blob = new Blob([localStorage[storage_id]], {type: "text/plain;charset=utf-8"});\n    filename = document.getElementById(filename).value\n    saveAs(blob, filename+".py");\n}\n// ]]></script>\n</p>\n<p><!-- 印出版次與關鍵字程式 --></p>\n<p>\n<script type="text/python3">// <![CDATA[\nfrom browser import document as doc\nimport ace\n# 清除畫布\ndef clear_bd(ev):\n    bd = doc["brython_div"]\n    bd.clear()\n# Brython 3.3.4 內建的 container 名稱為  \'container\' 且 turtle 輸出為 svg 必須使用 div 訂定 id\nAce = ace.Editor(editor_id="kw_editor", console_id="kw_console", container_id="kw__container", storage_id="kw_py_src" )\n# 從 gist 取出程式碼後, 放入 editor 作為 default 程式\ndef run():\n    # 利用 get 取下 src 變數值\n    try:\n        url = doc.query["src"]\n    except:\n        url = "插入個人gists中的程式文字檔網址"\n    prog = open(url).read()\n\n    # 將程式載入編輯區\n    Ace.editor.setValue(prog)\n    Ace.editor.scrollToRow(0)\n    Ace.editor.gotoLine(0)\n    # 直接執行程式\n    #ns = {\'__name__\':\'__main__\'}\n    #exec(prog, ns)\n    # 按下 run 按鈕\n    Ace.run()\n\n# 執行程式, 顯示輸出結果與清除輸出結果及對應按鈕綁定\ndoc[\'kw_run\'].bind(\'click\', Ace.run)\ndoc[\'kw_show_console\'].bind(\'click\', Ace.show_console)\ndoc[\'kw_clear_console\'].bind(\'click\', Ace.clear_console)\ndoc[\'clear_bd\'].bind(\'click\', clear_bd)\n# 呼叫函式執行\nrun()\n// ]]></script>\n</p>\n<p><!-- 用來顯示程式碼的 editor 區域 --></p>\n<div id="kw_editor" style="width: 600px; height: 300px;"></div>\n<p><!-- 以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合 --></p>\n<!-- 存擋表單開始 --><form><label>Filename: <input id="kw_filename" placeholder="input file name" type="text">.py</label> <input onclick="doSave(\'kw_py_src\', \'kw_filename\');" type="submit" value="Save"></form><!-- 存擋表單結束 -->\n<p></p>\n<!-- 執行與清除按鈕開始 -->\n<p><button id="kw_run">Run</button> <button id="kw_show_console">Output</button> <button id="kw_clear_console">清除輸出區</button><button id="clear_bd">清除繪圖區</button><button onclick="window.location.reload()">Reload</button></p>\n<!-- 執行與清除按鈕結束 -->\n<p></p>\n<!-- 程式執行 ouput 區 -->\n<div style="width: 100%; height: 100%;"><textarea autocomplete="off" id="kw_console"></textarea></div>\n<!-- Brython 程式執行的結果, 都以 brython_div 作為切入位置 -->\n<div id="brython_div"></div>\n<div><span style="color: #ff00ff;">欽入網頁python框架:</span></div>\n<div><span style="color: #ff00ff;"></span></div>\n<div></div> \n \n', 'tags': '', 'url': '建立網頁python 框架.html'}, {'title': 'Experience:', 'text': '此頁為學習及筆記紀錄 \n  導入 gearUtils-0.9.js Cango 齒輪繪圖程式庫  \n \n \n \n \n \n', 'tags': '', 'url': 'Experience:.html'}, {'title': 'Github', 'text': '如何建立紙模組，從不同的網站下載我所需要使用的目錄，並加入個人建的資料夾中。 \n 創建個人及分組網站倉儲： https://github.com/KEHUEISIN/wcm2022 \xa0， https://github.com/KEHUEISIN/wcm2022ag1 可自己建紙模組。 \n \n', 'tags': '', 'url': 'Github.html'}, {'title': 'onedrive', 'text': '因其只有5GB，當備份太多時，則電腦內的磁碟會無發運行。 \n 解決方法 :進入ONEDRIVE設定內，管理備份將它停止備份資料夾，後再到網站登入，將ONEDRIVE裡備份的資料夾全部刪掉，就可。 \n 影片同下: \n \n \n \n  接下來將 mp4 檔案從 downloads 目錄取出  \n \n \n \n   \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'onedrive.html'}, {'title': 'Wink', 'text': '需先錄製一段影片，後到老師所給的程式碼加入超文件範本，將影片插入我所要放置的頁面，並將超文 \n 件內的(名稱.mp4)改成自己所設的名稱。(影片路徑為 wcm2022/download s中) \n 下為插入程式碼: \n <script>// <![CDATA[\nvar winkVideoData = {\n  dataVersion: 1,\n  frameRate: 10,\n  buttonFrameLength: 5,\n  buttonFrameOffset: 2,\n  frameStops: {\n  },\n};\n// ]]></script>\n</p>\n<!-- 接下來將 mp4 檔案從 downloads 目錄取出 -->\n<div class="winkVideoContainerClass"><video width="1008" height="630" autoplay="autoplay" class="winkVideoClass" controls="controls" data-dirname="./../cmsimde/static" data-varname="winkVideoData" muted="true">\n<source src="./../downloads/(影片名稱).mp4" type="video/mp4" /></video>\n<div class="winkVideoOverlayClass"></div>\n<div class="winkVideoControlBarClass"><button class="winkVideoControlBarPlayButtonClass"></button> <button class="winkVideoControlBarPauseButtonClass"></button>\n<div class="winkVideoControlBarProgressLeftClass"></div>\n<div class="winkVideoControlBarProgressEmptyMiddleClass"></div>\n<div class="winkVideoControlBarProgressRightClass"></div>\n<div class="winkVideoControlBarProgressFilledMiddleClass"></div>\n<div class="winkVideoControlBarProgressThumbClass"></div>\n</div>\n<div class="winkVideoPlayOverlayClass"></div>\n</div> \n', 'tags': '', 'url': 'Wink.html'}, {'title': 'H1 midterm', 'text': '四技中任務影片 \n \n \n \n  接下來將 mp4 檔案從 downloads 目錄取出  \n \n \n \n   \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'H1 midterm.html'}, {'title': 'W17', 'text': 'H1 \n 網址: https://youtu.be/QtdPbtvFLhY \n 心得: 從一開始的不熟悉，遊玩了3~4次後才真正上手，對於新手來說此程式速度還是過於的快，需放慢速度才可釐清每一步的走法。 \n', 'tags': '', 'url': 'W17.html'}, {'title': '期末任務1', 'text': '\n wink影片 \n 因為軟體出現了問題，無法再網頁加入wink \n 心得: 參考同學的程式，上網找到的資料非常的雜，無法確定哪一個是真正的答案，所以不太清楚自己所理解的程式內容的正確性，畢竟每個人理解出來的內容都不一致，很多東西都有不同層面上的思考方向，雖然雜，但其實都是一個問題從不同地方做延伸。 \n', 'tags': '', 'url': '期末任務1.html'}, {'title': '期末任務2', 'text': '\n \n 此程式有借鑑同學的 \n', 'tags': '', 'url': '期末任務2.html'}, {'title': 'W13', 'text': '俄羅斯方塊 \n  導入 Brython 程式庫  \n \n \n \n \n  啟動 Brython  \n \n \n \n \n \n 網頁搭建run程式html開頭: \n <!-- 導入 Brython 程式庫 -->\n<script src="./../cmsimde/static/brython.js"></script>\n<script src="./../cmsimde/static/brython_stdlib.js"></script>\n<!-- 啟動 Brython -->\n<script>\nwindow.onload=function(){brython();}\n</script>\n<script type="text/python3">\n#print("可執行 Brython")\n \n \n \xa0 \n \xa0 \n 網頁搭建run程式html結尾: \n \n </script>\n<div id="brython_div"></div>\n \n \n  導入 Brython 程式庫  \n \n \n  啟動 Brython  \n \n \n \n', 'tags': '', 'url': 'W13.html'}, {'title': '計分', 'text': '\n \n \n \n  啟動 Brython  \n \n \n \n \n \n', 'tags': '', 'url': '計分.html'}, {'title': 'w14', 'text': '更改舊資料 \n \n \n \n \n  for ggame  \n \n \n \n \n \n \n \n \n  Cango 程式庫  \n \n \n \n \n \n \n \n \n  for Konva 程式庫  \n \n \n \n \n  導入 FileSaver 與 filereader  \n \n \n \n \n  導入 ace  \n \n \n \n \n \n \n  請注意, 這裡使用 Javascript 將 localStorage["py_src"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  #####  editor1 開始 #####  \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  \n Filename:  .py   \n  存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div 作為切入位置  \n  這裡的畫布 id 為 brython_div  \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n  graphics-column is for ggame  \n  #####  editor1 結束 #####  \n  以下可以開始利用 editor1 的設定編寫對應 Brython 程式  \n \n', 'tags': '', 'url': 'w14.html'}]};